import React from 'react';

const Login = () => {
    const onClickHandler = (event) => {
        event.preventDefault();
    }

    return (
        <div className='login'>
            <h3>Login</h3>
            <form>
                <label htmlFor='username'>username: </label>
                <input type='text' id='username' name='username' />
                <label htmlFor='logpwd'>password: </label>
                <input type='text' id='logpwd' name='logpwd' />
                <input type='submit' value='Log in' onClick={onClickHandler} />
            </form>
        </div>
    );
}

export default Login;
